window.bookSummaryJSON = "<p><b><i>New York Times</i></b><b> best seller</b></p> <p>Joining the ranks of <i>The Life-Changing Magic of Not Giving a F*ck</i>, <i>The Subtle Art of Not Giving a F*ck</i>, <i>You Are a Badass</i>, and <i>F*ck Feelings</i> is this refreshing, BS-free self-empowerment guide that offers an honest, no-nonsense, tough-love approach to help you move past self-imposed limitations.&nbsp;</p> <p>Are you tired of feeling f*cked up? If you are, Gary John Bishop has the answer. In this straightforward handbook, he gives you the tools and advice you need to demolish the slag weighing you down and become the truly unf*cked version of yourself. \"Wake up to the miracle you are,\" he directs. \"Here's what you've forgotten: You're a f*cking miracle of being.\" It isn't other people that are standing in your way; it isn't even your circumstances that are blocking your ability to thrive. It's yourself and the negative self-talk you keep telling yourself.&nbsp;</p> <p>In <i>Unf*ck Yourself</i>, Bishop leads you through a series of seven assertions:&nbsp;</p> <ul> <li>I am willing&nbsp;</li> <li>I am wired to win&nbsp;</li> <li>I got this&nbsp;</li> <li>I embrace the uncertainty&nbsp;</li> <li>I am not my thoughts; I am what I do&nbsp;</li> <li>I am relentless&nbsp;</li> <li>I expect nothing and accept everything&nbsp;</li> </ul> <p>Lead the life you were meant to have - <i>Unf*ck Yourself</i>.&nbsp;</p>"; 
